				cTg.visible = false;
				cTg.destination.gotoAndStop(1);		
				window.setTimeout(function(){cTg.destination.gotoAndStop(2)}, 1500);
				aktTextNr ="keinLand";
				_this.marker.alpha = 0;
			_this.marker.x = 200; 
